import RayaAxiosClient from './raya-axios-client';
import constants from 'CONSTANTS';

const getAllApplicants = async () => {
  if (process.env.DEBUG) {
    console.log('[applicantsService] getAllApplicants:');
  }
  const result = await RayaAxiosClient.get('/api/admin/applicants');
  return result;
};

export default {
  getAllApplicants,
};
